import React from 'react';
import img from '../assets/home-bg.jpeg';


function Home() {

  return (
    <div className="relative">
      <div className="absolute bottom-0 left-0 w-full h-full flex items-center justify-center z-10">
        <h1 className="flex font-thin font-mono animate-bounce text-8xl">Welcome</h1>
      </div>
      <img src={img} alt="home bg logo" className="w-full h-auto opacity-80" />
    </div>
  );
}

export default Home;
